e_report(filename=\"dask-report.html\"):\n   t = time.time()\n   # Get the Dask array global_t\n   gt = arrays[\"global_t\"]    \n   #gt = gt.rechunk({0: 1})\n   #print(gt.chunks)\n   # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"axis":{"id":"1016"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"1019","type":"Grid"},{"attributes":{},"id":"1482","type":"AllLabels"},{"attributes":{"coordinates":null,"formatter":{"id":"1429"},"group":null,"major_label_policy":{"id":"1430"},"ticker":{"id":"1017"},"visible":false},"id":"1016","type":"LinearAxis"},{"attributes":{"coordinates":null,"formatter":{"id":"1444"},"group":null,"major_label_policy":{"id":"1445"},"ticker":{"id":"1049"},"visible":false},"id":"1048","type":"LinearAxis"},{"attributes":{"axis":{"id":"1048"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1051","type":"Grid"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{},"id":"1441","type":"BasicTickFormatter"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"line_alpha":0.1,"line_color":"blue","x":{"field":"time"},"y":{"field":"write_bytes"}},"id":"1338","type":"Line"},{"attributes":{},"id":"1484","type":"DatetimeTickFormatter"},{"attributes":{"coordinates":null,"data_source":{"id":"121
